</educations>\n  <three-current-positions total="1">\n    <position>\n      <id>209765217</id>\n      <title>Undergraduate</title>\n      <summary>Communications and New Media</summary>\n      <start-date>\n        <year>2007</year>\n        <month>8</month>\n      </start-date>\n      <is-current>true</is-current>\n      <company>\n        <id>5524</id>\n        <name>National University of Singapore</name>\n        <type>Educational Institution</type>\n        <industry>Higher Education</industry>\n      </company>\n    </position>\n  </three-current-positions>\n  <three-past-positions total="2">\n    <position>\n      <id>135651238</id>\n      <title>Account Executive</title>\n      <summary>Involved in the research and execution processes for digital marketing and online advertising projects for clients; \nManaged statistical data and monitoring reports;\nHandled the management of a new online store, including content management, back end logistics and customer service.</summary>\n      <start-date>\n        <year>2010</year>\n        <month>7</month>\n      </start-date>\n      <end-date>\n        <year>2011</year>\n        <month>6</month>\n      </end-date>\n      <is-current>false</is-current>\n      <company>\n        <id>1347596</id>\n        <name>Respect and Dream Advertising</name>\n        <industry>Marketing and Advertising</industry>\n      </company>\n    </position>\n    <position>\n      <id>161702389</id>\n      <title>Artistic Editor, Opening and Closing Ceremonies</title>\n      <summary>Worked with the Publication Team to deliver 30,000 copies of the Program Booklet for the Opening Ceremony and Program Brochure for the Closing Ceremony. These were given to each member of the international audience. \n\nProduced the Media Guides for the Opening and Closing Ceremonies (2,100 copies each), which were distributed to both international and local media to assist their coverage of the ceremonies.</summary>\n      <start-date>\n        <year>2010</year>\n        <month>5</month>\n      </start-date>\n      <end-date>\n        <year>2010</year>\n        <month>7</month>\n      </end-date>\n      <is-current>false</is-current>\n      <company>\n        <id>382078</id>\n        <name>Singapore Youth Olympics Games OC</name>\n        <type>Government Agency</type>\n        <industry>Government Administration</industry>\n      </company>\n    </position>\n  </three-past-positions>\n  <num-recommenders>3</num-recommenders>\n  <recommendations-received total="3">\n    <recommendation>\n      <id>25800588</id>\n      <recommendation-type>\n        <code>colleague</code>\n      </recommendation-type>\n      <recommendation-text>Having observed the development of the programme booklets of the ceremonies, Agatha has proven herself to be highly dedicated and reliable. Faced with demanding deadlines, scarce resources and frequent changes; Agatha and her publication team showed grit and determination to ultimately complete the programme booklets that were used in these 2 momentous events. \n\nAgatha''s cheerful and easygoing personality also proved to be important in maintaining the morale and dynamics within the publication team, especially when the team was constantly facing huge external pressure.\n\nAgatha''s interpersonal skills and work ethic will undoubtedly make her an invaluable addition to any organization that she joins in the future.</recommendation-text>\n      <recommender>\n        <id>vEkx8uoCPo</id>\n        <first-name>Hee Xun</first-name>\n        <last-name>Leo</last-name>\n      </recommender>\n    </recommendation>\n    <recommendation>\n      <id>24934772</id>\n      <recommendation-type>\n        <code>education</code>\n      </recommendation-type>\n      <recommendation-text>Agatha was my student for Introduction to Communication Management, a course offered at the Communications and New Media department, NUS. Agatha is a keen and observant student who is diligent in her work as well. What struck me during my interactions with Agatha is her passion in both her life and her work, as well as how she is constantly in pursuit of the best. I appreciate that in students as it indicates how they are outside of the classroom. \n\nI was more than glad to recommend her for the overseas exchange programme organised by NUS, to China, for her to broaden her horizons and apply her knowledge. I am positive that Agatha will continue to give nothing but her best in her future endeavors.</recommendation-text>\n      <recommender>\n        <id>EwlFUcSBR0</id>\n        <first-name>Ou</first-name>\n        <last-name>Meimin</last-name>\n      </recommender>\n    </recommendation>\n    <recommendation>\n      <id>23693844</id>\n      <recommendation-type>\n        <code>colleague</code>\n      </recommendation-type>\n      <recommendation-text>I worked with Agatha in producing several publications for the Opening and Closing Ceremonies (OCC) of the inaugural Singapore 2010 Youth Olympic Games from April to September 2010. \n\nAs the artistic editor, Agatha was chiefly responsible for the layout design of the OCC publications, including the Opening Ceremony Program Booklet, Closing Ceremony Program Brochure and Media Guides. Agatha consistently produced works of the highest standards and displayed great expertise in the use of publications softwares like Adobe InDesign, Adobe Photoshop and Illustrator.\n\nIt was a pleasure working with Agatha on this project. Although our team was faced with numerous deadlines and several resource constraints, Agatha would always be pushing the team forward and thinking of new solutions to our limitations. For example, when our team had no idea on how to start working on the Media Guides, Agatha designed - from scrach - a new template which expedited our progress tremendously. \n\nAll in all, I enjoyed my working experience with Agatha and I believe that she would be a great asset to any organization. All the best!</recommendation-text>\n      <recommender>\n        <id>T5NjyJedo8</id>\n        <first-name>David</first-name>\n        <last-name>Yin</last-name>\n      </recommender>\n    </recommendation>\n  </recommendations-received>\n  <phone-numbers total="0"/>\n  <im-accounts total="0"/>\n  <twitter-accounts total="0"/>\n  <member-url-resources total="0"/>\n  <picture-url>http://media.linkedin.com/mpr/mprx/0_5fq3TI7WKyoMb-3VFIntTWyIKRfRwl3VFahYTeDn7ORINz9sddXDfHMZYv7XHnh9k290mf1T8xaT</picture-url>\n  <site-standard-profile-request>\n    <url>http://www.linkedin.com/profile?viewProfile=&amp;key=84028037&amp;authToken=-hy0&amp;authType=name&amp;trk=api*a147272*s155594*</url>\n  </site-standard-profile-request>\n  <api-standard-profile-request>\n    <url>http://api.linkedin.com/v1/people/7Hlvz7RKCf</url>\n    <headers total="1">\n      <http-header>\n        <name>x-li-auth-token</name>\n        <value>name:-hy0</value>\n      </http-header>\n    </headers>\n  </api-standard-profile-request>\n  <public-profile-url>http://www.linkedin.com/pub/agatha-soh/24/183/405</public-profile-url>\n</person>\n', '2011-10-31 19:09:55');
